@wintonARK Strange, if true. 

- Tesla already uses iron-phosphate for medium range cars made in our Shanghai factory.

- A monocell is electrochemically impossible, as max voltage is ~100X too low. Maybe they meant cells bonded together, like our structural battery pack?

@WholeMarsBlog Banning alcohol caused the biggest rise in organized crime in American history. 

That was dumb.

Same logic applies to other drugs. Alcohol is just a legacy drug.

@WallStreetSilv People often incorrectly think health care is a matter of money, but it is actually a matter of doctors per capita. 

Unless there is a magic doctor factory somewhere, it takes ~30 years from birth to educate a doctor. 

